import React from 'react'

const Hourly = ({ hour }) => {

  const getTime = () => {
    const time = new Date(hour.time * 1000);

    return time
  }
  return (
    <div>
      <h6>{getTime}</h6>
    </div>
  )
}

export default Hourly
